import "./widget.css"
import DonutSmallIcon from '@mui/icons-material/DonutSmall';
import PersonIcon from '@mui/icons-material/Person';

const Widget = ({type}) => {
    let data;
    switch(type){
        case "revenue":
            data={
                title:"Revenue",
                isMoney:false,
                icon:<DonutSmallIcon className="icon"/>
            };
            break;
            case "orders":
            data={
                title:"Orders",
                isMoney:false,
                icon:<DonutSmallIcon className="icon"/>
            };
            break;
            case "customers":
            data={
                title:"Customers",
                isMoney:false,
                icon:<PersonIcon className="icon"/>
            };
            break;
            default:
                break;
    }
  return (
    <div className="widget">
        <div className="left">
            <DonutSmallIcon className="icon"/>
        </div>
        <div className="middle">
            <span className="title">Revenu</span>
            <span className="money">$21456</span>
        </div>
        <div className="right">
            <div className="percent positive">
                +2.65%
            </div>
        </div>
    </div>
  )
}

export default Widget
